const routesPath = {
  notfound: '/notfound',
  leave: '/leave',
  login: '/login',
  signup: '/signup',
  verify: '/verify/:ID',
  verifyEmail: '/verifyEmail/:ID',
  magicLink: '/magicLink/:ID',
  anonymousLink: '/anonymousLink/:ID',
  forgotPassword: '/forgot_password',
  resetPassword: '/reset_password/:ID',

  dashboard: '/',
  users: '/users',
  profile: '/profile',
  webinars: '/webinars',
  group: '/group',
  recording: '/recording',
  settings: '/settings',
  conference: '/conference/:ID',
  conferenceDetail: '/conferenceDetail/:ID',
  userDetail: '/userInfo/:ID',
  groupDetail: '/groupDetail/:ID',
  recordings: '/recordings',
  report: '/report'
}

const noAuthenRoutes = [
  {
    path: routesPath.signup,
    exact: true,
    component: 'signup'
  },
  {
    path: routesPath.login,
    exact: true,
    component: 'login'
  },
  {
    path: routesPath.forgotPassword,
    exact: true,
    component: 'forgotPassword'
  },
  {
    path: routesPath.resetPassword,
    exact: true,
    component: 'resetPassword'
  }
]

const authenRoutesDashboard = [
  {
    path: routesPath.users,
    exact: true,
    component: 'users'
  },
  {
    path: routesPath.webinars,
    exact: true,
    component: 'webinars'
  },
  {
    path: routesPath.dashboard,
    exact: true,
    component: 'conferences'
  },
  {
    path: routesPath.profile,
    exact: true,
    component: 'profile'
  },
  {
    path: routesPath.group,
    exact: true,
    component: 'groups2'
  },
  {
    path: routesPath.recording,
    exact: true,
    component: 'recording'
  },
  {
    path: routesPath.settings,
    exact: true,
    component: 'settings'
  },
  {
    path: routesPath.conferenceDetail,
    exact: true,
    component: 'conferenceDetail'
  },
  {
    path: routesPath.userDetail,
    exact: true,
    component: 'userDetail'
  },
  {
    path: routesPath.groupDetail,
    exact: true,
    component: 'groupDetail2'
  },
  {
    path: routesPath.recordings,
    exact: true,
    component: 'recordings'
  },
  {
    path: routesPath.report,
    exact: true,
    component: 'report'
  }
]

const authenRoutesOther = [
  {
    path: routesPath.conference,
    exact: true,
    component: 'conference2'
  }
]

const freeRoutes = [
  {
    path: routesPath.leave,
    exact: true,
    component: 'leave'
  },
  {
    path: routesPath.verify,
    exact: true,
    component: 'verify'
  },
  {
    path: routesPath.verifyEmail,
    exact: true,
    component: 'verifyEmail'
  },
  {
    path: routesPath.magicLink,
    exact: true,
    component: 'magicLink'
  },
  {
    path: routesPath.anonymousLink,
    exact: true,
    component: 'anonymousLink'
  },
  {
    path: routesPath.notfound,
    exact: true,
    component: '404'
  }
]

export { routesPath, noAuthenRoutes, authenRoutesOther, authenRoutesDashboard, freeRoutes }
